from selenium.webdriver.common.by import Byfrom common.common_method.Login import Loginclass Find_Element(Login):    def ID(self,value):        id=self.driver.find_element(By.ID,value)        return id    def CSS(self,value):        css=self.driver.find_element(By.CSS_SELECTOR,value)        return css    def Xpath(self,value):        xpath=self.driver.find_element(By.XPATH,value)        return xpath